Along the way, Deathstalker learns of a tournament from Kaira, a female warrior (


Lana Clarkson

), in which warriors are invited to participate in contests until a winner is determined, thereby inheriting Munkar's kingdom.  A great prize is promised and the two warriors decide to band together for the journey.  Along the way, the two help several unfortunate souls being oppressed by Munkar and his men, adding to the troupe of characters going to the tournament. One evening, after a fierce but victorious battle, the two partners make love.

Arriving at the tournament site, the two warriors part ways and enter as individual competitors. Only after the games begin is it announced that the prize is Princess Codill (










Barbi Benton









), who Munkar has chained to a stone above the arena, as his prisoner.
